description:
紙のようですが。。。いいえ違います。BRUSHUP STANDARD(ブラッシュアップ スタンダード)の不織布タイベックを使ったタブレットケース。<br>デュポン タイベックとは、アメリカ・デュポン社が独自開発した高密度ポリエチレン製の不織布です。超軽量で、通気性、耐水性があり、強度がある素材です。<br>[サイズ]: 高さ/約33cm, 幅/約26cm, 奥行/約1cm<br>[素材]: タイベック<br>[生産国]: 中国<br>【BRUSHUP STANDARD(ブラッシュアップスタンダード)とは……】<br>日常使いのアイテムを特徴のある素材で仕上げたBRUSHUP STANDARD。実用性とデザイン性を同時に満足させてくれる。<br>※商品色はご覧になるモニターの特性により実物の色と多少異なります。<br>※仕様変更により予告なく素材や形状が変更となる場合があります。あらかじめご了承ください。<br>※熱や摩擦、水濡れなどで色移りする場合がありますので、ご注意ください。<br><center><img src="https://image.rakuten.co.jp/vvv/cabinet/category/outdoor16_01.jpg" width="70%" border="0"><br><br>
</center>

