商品の説明:<br><br>
超軽量、超薄型を備えたスマートケース、大切なタブレットをキズや衝撃から守ると同時にファッションを感じさせられます。<br><br>
高級PUレザーで、綺麗で高級感のあふれる仕様となっております。<br><br>
高品質、スタイリッシュ、丈夫で、脱着することは便利です。<br><br>
マグネットオートスリープにより、フラップを開閉することで自動的にスリープOn/Offが行われ、ボタンを押さなくてもすぐに使用できます。<br><br>
スタンドタイプなので、横向きに立てかけて、二つの角度で動画視聴、読書、WEBなどに楽しめます。<br><br>
